import React from "react";
import { Button, Container, Segment } from "semantic-ui-react";

export const Fronti = () => {
  return (
      <Container>
    <Segment textAlign='center' tertiary clearing>
      <Button compact floated="right" content="Ndrysho" color="black"></Button>
      <h3>Hello there</h3>
      </Segment>
      <Segment textAlign='center' tertiary clearing>
      <Button compact floated="right" content="Ndrysho" color="black"></Button>
      </Segment>
      <Segment textAlign='center' tertiary clearing>
      <Button compact floated="right" content="Ndrysho" color="black"></Button>
      </Segment>
      <Segment textAlign='center' tertiary clearing>
      <Button compact floated="right" content="Ndrysho" color="black"></Button>
      </Segment>
    </Container>
  );
};
